import p from '../../img/profile.png';
import React, { useState } from 'react';
import Button from '@material-ui/core/Button';
import { signIn } from '../../store/actions/signIn';
import InputAdornment from '@material-ui/core/InputAdornment';
import TextField from '@material-ui/core/TextField';
import AccountCircle from '@material-ui/icons/AccountCircle';
import "./Login.scss"

import clsx from 'clsx';
import { makeStyles } from '@material-ui/core/styles';
import IconButton from '@material-ui/core/IconButton';
import FilledInput from '@material-ui/core/FilledInput';
import FormControl from '@material-ui/core/FormControl';
import Visibility from '@material-ui/icons/Visibility';
import VisibilityOff from '@material-ui/icons/VisibilityOff';
const useStyles2 = makeStyles((theme) => ({
  margin: {
    margin: theme.spacing(1),
  },
}));

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
  },
  margin: {
    margin: theme.spacing(1),
  },
  withoutLabel: {
    marginTop: theme.spacing(3),
  },
  textField: {
    width: '25ch',
  },
}));

const SignIn = (props) => {
  const classes2 = useStyles();
  const [values, setValues] = React.useState({
    amount: '',
    password: '',
    weight: '',
    weightRange: '',
    showPassword: false,
  });

  const handleChange = (prop) => (event) => {
    setValues({ ...values, [prop]: event.target.value });
  };

  const handleClickShowPassword = () => {
    setValues({ ...values, showPassword: !values.showPassword });
  };

  const handleMouseDownPassword = (event) => {
    event.preventDefault();
  };



  const classes = useStyles();
  let email = "";
  //לא עובד useState לבדוק למה 
  let [password, setPassword] = useState("");

  return (
    <center>
      <form className={classes.root} noValidate autoComplete="off">
       <center> <img className='profile_img' src={p}></img>
        <TextField onChange={(e) => { email = e.target.value }} required
          className={classes.margin}
          id="input-with-icon-textfield"
          placeholder="Email"

          InputProps={{
            startAdornment: (
              <InputAdornment position="start">
                <AccountCircle />
              </InputAdornment>
            ),
          }}
        />
        <FormControl className={clsx(classes.margin, classes.textField)} variant="filled">
          <FilledInput
            type={values.showPassword ? 'text' : 'password'}
            onChange={handleChange('password')}
            placeholder="Password"
            // className="xxx"
            onChange={(e) => { setPassword(e.target.value) }}

            startAdornment={
              <InputAdornment position="start">
                <AccountCircle />
              </InputAdornment>
            }
            endAdornment={
              <InputAdornment position="end">
                <IconButton
                  onClick={handleClickShowPassword}
                  onMouseDown={handleMouseDownPassword}
                >
                  {values.showPassword ? <Visibility /> : <VisibilityOff />}
                </IconButton>
              </InputAdornment>
            }
          />
        </FormControl>

        <Button variant="contained" onClick={() => signIn(password, email)}>Login</Button>
        {password == "" ? <h2>Forgot Password?</h2> : null}
       
        </center>

      </form>
    </center>
  );
}

export default SignIn;
